import { 
  BrowserRouter as Router,
  Switch, Route
 } from "react-router-dom"
import Main from "./pages/Main"


function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Main/>
        </Route>

      </Switch>

    </Router>
  );
}

export default App;
